// Login.js

import React, { useState } from 'react';
import './index.css';

import { ReactComponent as FacebookIcon } from './facebook-icon.svg';
import { ReactComponent as TwitterIcon } from './twitter-icon.svg';
import { ReactComponent as GoogleIcon } from './google-icon.svg';


function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    // TODO: Send user's input to server or perform validation

    // Reset the form
    setEmail('');
    setPassword('');
  };

  return (
    <div className="login-container">
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="email">Email</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(event) => setEmail(event.target.value)}
          />
        </div>
        <div>
          <label htmlFor="password">Password</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(event) => setPassword(event.target.value)}
          />
        </div>
        <button type="submit">Sign In</button>
        <div className="social-login">
          <span>Or sign in with:</span>
          <div className="social-icons">
            <FacebookIcon />
            <TwitterIcon />
            <GoogleIcon />
          </div>
        </div>
      </form>
    </div>
  );
}

export default Login;
